  false,\n\t\"url\": null,\n\t\"notes\": \"This study plan is for the assessment and
  adaptive management of environmental processes with sentinel plant species at Charles
  M. Russell National Wildlife Refuge.  This work philosophy and study methods for
  sentinel plant field inventory is for the 2007 field season at CMR.  It contains
  a list of sentinel plants that are the first to decline from fire effects or grazing
  and field methods for conducting sentinel plant field inventory to compare abundance,
  use and trends of sentinel species that are the first to decline.\",\n\t\"owner_org\":
